#   https://www.hackerrank.com/challenges/weighted-uniform-string


def weightedUniformStrings(s, queries):
    cnt, scoreDict, querySet = 1, {chr(i + ord('a')): i + 1 for i in range(26)}, set()
    for i, c in enumerate(s):
        if 0 <= i - 1 and s[i - 1] == c:
            cnt += 1
        else:
            print(s[i - 1], scoreDict[s[i - 1]], cnt, scoreDict[s[i - 1]] * cnt)
            cnt = 1
        querySet.add(scoreDict[c] * cnt)
    #print(sorted(list(querySet))[:1000])
    return ['Yes' if query in querySet else 'No' for query in queries]


